import React, { Component } from 'react';
import './thirdPart.css';

class ThirdPart extends Component {
    state = { 
        comments : [
            ['Michael Elijah', '@Michaelelijah', 'The networking at Web Summit is like no other European tech conference.', ''],
            ['Olivia Harper', '@Oliviaharper', 'The connections you make at Web Summit are unparalleled, we met users all over the world.', ''],
            ['James Logan', '@Jameslogan', 'Web Summit will increase your appetite, your inspiration, and your network.', ''],
            ['Luca Rastelli', '@luca-rastelli', 'Is your marketing strategy ready for 2021? Discover the trends that will change the marketing landscape this year.', ''],
            ['Linda Rossi', '@LindaRossi', 'Leaders dont create followers, they create more leaders, and thats what we strive to accomplish at Terramar with our weekly supervisor development sessions', '']
    ]
     }
    render() { 
        return ( 
            <div className={'ThirdPart'}>
                <ul>
                    <li>{this.state.comments[0]}</li>
                </ul>
            </div>
         );
    }
}

export default ThirdPart;
